import {Box} from "@mui/material";

import SwipeDrawer from "./SwipeDrawer";
import Notes from "./notes/Notes";

const Home = () => {
    return (
        <Box style={{ display: 'flex'}}>
            <SwipeDrawer />
            <Notes />
        </Box>
    )
}

export default Home;
